#include <string>
using namespace llvm;

namespace llvm {
  class AMDEDGToIA64Translator : public ModulePass {

  public:
    static char ID; // Pass identification, replacement for typeid

    AMDEDGToIA64Translator() : ModulePass(ID), mSetSPIRCC(false) {}

    AMDEDGToIA64Translator(bool _SetSPIRCC)
      : ModulePass(ID), mSetSPIRCC(_SetSPIRCC) {
      initializeAMDEDGToIA64TranslatorPass(*PassRegistry::getPassRegistry());
    }

    virtual bool runOnModule(Module &M);
    bool hasError() { return !errorMessage.empty(); }
    std::string getErrorMessage() { return errorMessage;}

  private:
    bool mSetSPIRCC;
    StringMap<StringRef> EDGToIA64Map;
    std::string errorMessage;

    void initializeMap(Module& M);
  };
} //End anonymous namespace


INITIALIZE_PASS(AMDEDGToIA64Translator, "edgtoia64translator",
                "AMD EDG To IA64 Translator", false, false);

char AMDEDGToIA64Translator::ID = 0;

ModulePass *llvm::createAMDEDGToIA64TranslatorPass(bool SetSPIRCC) {
  return new AMDEDGToIA64Translator(SetSPIRCC);
}

static void setSPIRFuncCC(Function* fi) {
  fi->setCallingConv(CallingConv::SPIR_FUNC);
  for (Value::use_iterator ui = fi->use_begin(), ue = fi->use_end();
      ui != ue; ++ui) {
    if (CallInst *Inst = dyn_cast<CallInst>(*ui)) {
      Inst->setCallingConv(CallingConv::SPIR_FUNC);
    }
  }
}

static bool isKernelFunc(const Function *F) {
  return F->getName().startswith("__OpenCL_")
    && F->getName().endswith("_kernel");
}

bool AMDEDGToIA64Translator::runOnModule(Module& M) {
  errorMessage.clear();
  initializeMap(M);

  bool Changed = false;
  for (Module::iterator I = M.begin(), E = M.end(); I != E; ++ I) {
    if (mSetSPIRCC) {
      if (isKernelFunc(I))
        I->setCallingConv(CallingConv::SPIR_KERNEL);
      else
        setSPIRFuncCC(I);
    }

    // Fix mangled name if this is a known builtin.
    if (!I->hasName())
      continue;
    StringMap<StringRef>::iterator K = EDGToIA64Map.find(I->getName());
    if (K == EDGToIA64Map.end())
      continue;
    DEBUG(dbgs() << I->getName() << " => " << K->second << '\n');
    // Before linking, builtins are not expected to have definitions.
    assert(I->empty());
    I->setName(K->second);
    Changed = true;
  }
  return Changed;
}

bool llvm::AMDEDGToIA64Translate(
    llvm::Module &M,
    std::string *errorMessage)
{
  PassManager PM;
  AMDEDGToIA64Translator *P = new AMDEDGToIA64Translator();
  PM.add(P);
  PM.run(M);

  bool hasError = P->hasError();
  if (errorMessage && hasError)
    *errorMessage = P->getErrorMessage();
  return !hasError;
}

